    return (
      <div
        style={{
          paddingLeft: "30px"
        }}
      >
        <Header title="TRASH IT" />

        <div>
          <h1 style={{ color: "blue" }}>
            The best time to dispose that Trash is Now!!
          </h1>
          <h3>Cleaniness is next to Godliness</h3>
          <div>
            <img className="street" />
          </div>
          <h4>
            Why not register with us today and let us take away your Garbage
          </h4>
        </div>

        <Footer />
      </div>
    );
  }
}
export default Home;
